/**
 * Returns energy index
 *
 * @param[in]   E_MeV_u		energy in MeV/u
 * @return      energy index
 */
long    AT_RDD_RadicalDiffusion_get_energy_idx(const double E_MeV_u);

/**
 * Returns radial dose for the radical diffusion model
 *
 * @param[in]   r_m		radius (distance from track) in m
 * @param[in]   E_MeV_u		energy in MeV/u
 * @param[in]	particle_no	particle number
 * @param[in]	material_no material index
 * @return      radial dose in Gy
 */
double  AT_RDD_RadicalDiffusion_Gy( const double r_m,
		 const double E_MeV_u,
		 const long particle_no,
		 const long material_no);
/**
 * Returns radius for the radical diffusion model
 *
 * @param[in]   d_Gy	radial dose in Gy
 * @param[in]   E_MeV_u		energy in MeV/u
 * @param[in]	particle_no	particle number
 * @param[in]	material_no material index
 * @return      radius in m
 */
double  AT_inverse_RadicalDiffusion_m( const double d_Gy,
		const double E_MeV_u,
		 const long particle_no,
		 const long material_no);

/**
 * Returns minimal radius for the radical diffusion model
 *
 * @param[in]   E_MeV_u		energy in MeV/u
 * @return      minimal radius in m
 */
double	 AT_r_min_RadicalDiffusion_m( const double E_MeV_u);

/**
 * Returns maximum radius for the radical diffusion model
 *
 * @param[in]   E_MeV_u		energy in MeV/u
 * @return      maximum radius in m
 */
double	 AT_r_max_RadicalDiffusion_m( const double E_MeV_u);

/**
 * Returns minimal dose for the radical diffusion model
 *
 * @param[in]   E_MeV_u		energy in MeV/u
 * @return      minimal dose in Gy
 */
double	 AT_d_min_RadicalDiffusion_Gy( const double E_MeV_u,
		 const long particle_no,
		 const long material_no);

/**
 * Returns maximum dose for the radical diffusion model
 *
 * @param[in]   E_MeV_u		energy in MeV/u
 * @return      maximum dose in Gy
 */
double	 AT_d_max_RadicalDiffusion_Gy( const double E_MeV_u,
		 const long particle_no,
		 const long material_no);


/**
 * Returns energy for the radical diffusion model
 *
 * @param[in]   E_MeV_u		energy in MeV/u
 * @return      energy in MeV per nucleon
 */
double	 AT_E_RadicalDiffusion_MeV_u( const double E_MeV_u);

/**
 * Returns number of bins used
 *
 * @param[in]   E_MeV_u		energy in MeV/u
 * @return      number of bins
 */
long	AT_n_bins_RadicalDiffusion( const double E_MeV_u);

